const change_format2 = (list) => {
    for (i=0; i<list.length; i++){
        let myMap = new Map();
        const currency = list[i][0]
        const detail = list[i][3]
        for (j=0; j<detail.length; j++){
            var date_list = []
            var revenue_list = []
            var fx_list = []
            if(list[i][3][j][0]=='all'){
                for (k=1; k<list[i][3][j].length; k++){
                    date_list.push(list[i][3][j][k][0])
                    revenue_list.push(list[i][3][j][k][1][0])
                    fx_list.push(list[i][3][j][k][1][1])
                }
            }
            myMap.set(currency, [date_list, revenue_list, fx_list])
